import React from "react";

const styles = {
  card: {
    margin: 10,
    background: "#e8eaf6"
  },
  heading: {
    background: "#9a74db",
    minHeight: 50,
    lineHeight: 3.5,
    fontSize: "1.2rem",
    color: "white",
    padding: "0 20px",
    textAlign: "center"
  }
};

function Navbar() {
  return (
    <div style={styles.card}>
      <div style={styles.heading}>spongeBob clickGame</div>
      <div style={styles.heading}>Click Image to Begin</div>
      <div style={styles.heading}>Score: </div>
      <div style={styles.heading}>High Score: </div>


    </div>
  );
}

export default Navbar;
